<div class=diagram-container><svg id=pvjs-diagram-1 version=1.1 baseprofile=full xmlns=http://www.w3.org/2000/svg xlink=http://www.w3.org/1999/xlink ev=http://www.w3.org/2001/xml-events preserveaspectratio=xMidYMid width=1024 height=768 style="overflow: hidden; background-color:white; "><g class=viewport transform=matrix(0.15300589799880981,0,0,0.15300589799880981,364.678993248997,17.669943962819435)><defs id=defs><style type=text/css>	svg {
		color-interpolation: auto;
		image-rendering: auto;
		shape-rendering: auto;
		vector-effect: non-scaling-stroke;
                background: white;
	/* removed fill and stroke since they override marker specs */
	/*	fill: white;
    		stroke: black; */
	}

	/* default color for pathway elements */
	.default-fill-color {
		fill: black;
	}
	.default-stroke-color {
		stroke: black;
	}

	/* default color of the background drawing board */
	.board-fill-color {
		fill: white;
	}
	.board-stroke-color {
		stroke: white;
	}

	.text-area {
		font-family: Sans-Serif, Helvetica, Arial;
		text-align: center;
		vertical-align: middle;
		font-size: 10px;
		fill: black;
		fill-opacity: 1;
		stroke: none;
	}

	.citation {
		font-family: Sans-Serif, Helvetica, Arial;
		text-align: center;
		vertical-align: top;
		font-size: 7px;
		fill: #999999;
		fill-opacity: 1;
		stroke: none;
	}

	.info-box {
		font-family: Sans-Serif;
		font-size: 10px;
		fill: black;
		stroke: none;
		text-align: left;
		vertical-align: top;
	}

	.info-box-item-property-name {
		font-weight: bold;
	}

	.info-box-item-property-value {
	}

	.data-node {
		text-align: right;
		fill-opacity: 1;
		fill: white;
		stroke: black;
		stroke-width: 1;
		stroke-dasharray: 0;
		stroke-miterlimit: 1;
    		pointer-events:auto;
	}
	.data-node:hover {
	 	cursor: pointer;
	}

	.has-xref:hover {
		cursor: pointer;
	}

	.data-node.gene-product {
	}

	.metabolite {
		stroke: blue;
	}

	.data-node.metabolite &gt; .text-area {
		fill: blue;
		fill-opacity: 1;
		stroke: none;
	}

	.data-node.pathway {
		stroke: none;
		fill-opacity: 0;
	}

	.data-node.pathway &gt; .text-area {
		fill: rgb(20,150,30);
		fill-opacity: 1;
		font-size: 12px;
		font-weight: bold;
	}

	.data-node.protein {
	}

	.data-node.rna {
	}

	.data-node.unknown {
	}

	.label {
		stroke: null;
		stroke-width: 0;
		fill-opacity: 0;
		stroke-dasharray: 0;
		stroke-miterlimit: 1;
	}

	.shape {
		fill-opacity: 0;
		stroke: black;
		stroke-dasharray: 0;
		stroke-miterlimit: 1;
	}

	.shape.none {
		fill: none;
		fill-opacity: 0;
		stroke: none;
	}

	g.group-node &gt; .shape {
		fill-opacity: 0.098;
		stroke: gray;
		stroke-miterlimit: 1;
		stroke-width: 1px;
    		pointer-events:none;
	}

	.group-node {
		fill-opacity: 0.098;
		stroke: gray;
		stroke-miterlimit: 1;
		stroke-width: 1px;
    		pointer-events:none;
	}

	.group-node &gt; .text-area {
		fill-opacity: 0.4;
		font-family: Serif, Times;
		font-size: 32px;
		fill: black;
		stroke-width: 0;
		font-weight: bold;
  	}

	.group-node.none {
		fill: rgb(180,180,100);
		stroke-dasharray: 5,3;
	}

	.group-node.none &gt; .text-area {
		display: none;
  	}

	/*.group-node.none:hover {
		fill: rgb(255,180,100);
		fill-opacity: 0.05;
	}*/

	.group-node.group {
		fill-opacity: 0;
		stroke: none;
	}

	.group-node.group &gt; .text-area {
		display: none;
  	}
	/*.group-node.group:hover {
		fill: rgb(0,0,255);
		stroke-width: 1px;
		stroke-dasharray: 5,3;
		stroke: gray;
		fill-opacity: 0.1;
	}*/

	.group-node.complex {
		fill: rgb(180,180,100);
	}

	.group-node.complex &gt; .text-area {
		display: none;
  	}
	/*.group-node.complex:hover {
		fill: rgb(255,0,0);
		fill-opacity: 0.05;
	}*/

  	.group-node.pathway {
		fill: rgb(0,255,0);
		stroke-dasharray: 5,3;
	}
	/*.group-node.pathway:hover {
		fill: rgb(0,255,0);
		fill-opacity: 0.2;
	}*/
	.group-node.pathway &gt; .text-area {
		fill: rgb(20,150,30);
		stroke: rgb(20,150,30);
  }

  .cellular-component {
		fill-opacity: 0;
		stroke: silver;
	}

  .graphical-line {
		fill:none;
		stroke: black;
		stroke-width: 1px;
	}

	.interaction {
		fill:none;
		stroke: black;
		stroke-width: 1px;
	}

	marker {
		/* this is what should work per the spec
		   stroke-dasharray: none; */
		/* but I need to add this to make it work in Safari */
		stroke-dasharray: 9999999999999999999999999;
	}

  .marker-end {
    -webkit-transform: rotate(180deg);
    -webkit-transform-origin: 50% 50%;

    -o-transform: rotate(180deg);
    -o-transform-origin: 50% 50%;

    transform: rotate(180deg);
    transform-origin: 50% 50%;
  }

	.solid-stroke {
		/* this is what should work per the spec
		   stroke-dasharray: none; */
		/* but I need to add this to make it work in Safari */
		stroke-dasharray: 9999999999999999999999999;
	}

	.dashed-stroke {
		stroke-dasharray: 5,3;
	}
</style></defs><g id=viewport><path d=M43.394489682048814,4400L1521.1722674598261,4400 fill=transparent id=id3b9f67a stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.39448905987598,3800L1521.1722668376533,3800 fill=transparent id=cbe54 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.3945147731131,300L1521.172292550891,297.1794871794882 fill=transparent id=bd26b stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.39450423506054,3700L1521.172282012838,3700 fill=transparent id=fbba0 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.39449541284401,3100L1521.1722731906216,3100 fill=transparent id=ea535 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.39448532683889,3000L1521.1722631046164,3000 fill=transparent id=bb9f7 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.39453860038884,2400L1521.1723163781662,2400 fill=transparent id=c3d22 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.394511341441,2300L1521.1722891192185,2300 fill=transparent id=d0ad7 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.39454416105866,1700L1521.1723219388361,1700 fill=transparent id=d3372 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.394521879493624,1600L1521.172299657271,1600 fill=transparent id=c87b5 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.394485326838975,1000L1521.1722631046175,1000 fill=transparent id=c70e2 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M43.39454759273079,900L1521.1723253705084,900 fill=transparent id=eca55 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M700,185.55559355115136L700,4774.444482440042 fill=transparent id=id41348e99 stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=M100,185.556L100,4774.4444980318585 fill=transparent id=fa68f stroke-dasharray=5,3 stroke-width=1 stroke=#cccccc></path><path d=
